import React from 'react';


  export default function List(props) {
    //    console.log(props.list);
       let lista = []
       for(let i = 0; i < props.list.length; i++) {
        lista.push(
          <>key={i} item={props.items[i]} </>
        );
      }
    return (
        <div>
          <h2>List</h2>
         <>{lista}</>
        </div>
    );
}
